import React from "react";
import { Link } from "react-router-dom";

import PropTypes from "prop-types";

import "./header.css";
import "./container_woman.css";

class ContainerWoman extends React.Component {
  render() {
    const {
      img_alt,
      img_src,
      img_classname,
      icon_alt,
      icon_src,
      icon_classname,
      description,
      link,
      name,
      link_classname,
    } = this.props;
    return (
      <div className="homepage-container-woman">
        <img
          alt={this.props.img_alt}
          src={this.props.img_src}
          className={this.props.img_classname}
        />
        <div className="homepage-container4 source">
          <img
            alt={this.props.icon_alt}
            src={this.props.icon_src}
            className={this.props.icon_classname}
          />
          <div className="target">
            <h1 className="homepage-text20 textXL">{this.props.name}</h1>
            <p className="homepage-text21">
              <span>{this.props.description}</span>
            </p>
            <a
              href={this.props.link}
              target="_blank"
              rel="noreferrer noopener"
              className={this.props.link_classname}
            >
              Learn more about her here!
            </a>
          </div>
        </div>
      </div>
    );
  }
}

export default ContainerWoman;
